class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        l = list(s)
        if(len(s) == 0): return 0
        m = 1
        letters = []
        start = 0
        end = 0
        while(end < len(l)):
            letter = l[end]
            if(letter not in letters):
                end += 1
                letters.append(letter)
            else:
                repInd = letters.index(letter)
                if(len(letters) > m): m = len(letters)
                letters = []
                start += 1
                end = start
        if(len(letters) > m): m = len(letters)
        return m
        
